import { call, put} from 'redux-saga/effects'
import MyIdCardActions from '../Redux/MyIdCardRedux'
import LoginActions from '../Redux/LoginRedux'

let idCardData = 'data:image/png;base64,'

// attempts to login
export function * myidcard (api) {
  console.tron.log('I am coming from myIdCard Sagas')
    // api.setsmTokenHeaders(smToken);
  const response = yield call(api.getMyIdCard)
  if (response.status == '200') {
    // dispatch success
    var data = response.data.data
    data = {
      srcData: idCardData,
      idCardHeaderVisible: false
    }
    yield put(MyIdCardActions.myIdCardSuccess(data))
  } else {
    // dispatch successful logins
    console.tron.log('I am coming from failuer ')
    var error = response.problem
    yield put(MyIdCardActions.myIdCardFailure(error))
  }
}
